import React from "react";
import "./App.css";
import LoginForm from "./components/landingPage/LoginForm";

const App = () => {
  return (
    <div className="app">
      {/* THIS IS THE CONTAINER FOR THE PHONES IMAGE AND FORM BOX  */}
      <div className="box1">
        <div className="phones"></div>
        <div className="formBox">
          <img className="logo" src="https://i.ibb.co/gPdP4X9/instagram.png" />
          <LoginForm />
          <SignupForm />
        </div>
      </div>

      {/* THIS IS THE CONTAINER FOR THE FOOTER LINKS */}
      <div className="extLinks"></div>
    </div>
  );
};

export default App;
